import React, {useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const [list,changeList] = useState([
    {"name": "Alex"},
    {"name": "Seca"}
  ])

  useEffect(() => {

    document.onload = `This is what is on the list: ${list}`
  })

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p id="paragraph">
          Thingy
        </p>
      </header>
    </div>
  );
}

export default App;
